import React from "react";

const ContactPage = () => {
  return (
    <div className="change-profile-page-wrapper">
      <div className="change-profile-section p__size font__bold font__p">
        <p>If you want to contact with us:</p>
        <p>send email on</p>
        <p className="app_color_font">Ask-Away@gmail.com</p>
      </div>
    </div>
  );
};

export default ContactPage;
